var grupoService={add:function(e,t){try{connector.post(url.grupo.add,JSON.stringify(e),function(e){null!=e?(successMessage({title:message.grupo.add.title,content:message.grupo.add.success}),t(e)):errorMessage({title:message.grupo.add.title,content:message.grupo.add.error})})}catch(e){console.log(e)}},update:function(e,t){try{connector.post(url.grupo.update,JSON.stringify(e),function(e){null!=e&&1===e?(successMessage({title:message.grupo.update.title,content:message.grupo.update.success}),t(e)):errorMessage({title:message.grupo.update.title,content:message.grupo.update.error})})}catch(e){console.log(e)}},remove:function(e,t){try{connector.post(url.grupo.delete,JSON.stringify(e),function(e){null!=e&&1===e?(successMessage({title:message.grupo.delete.title,content:message.grupo.delete.success}),t(e)):errorMessage({title:message.grupo.delete.title,content:message.grupo.delete.error})})}catch(e){console.log(e)}},list:function(e,t){try{connector.post(url.grupo.list,JSON.stringify(e),function(e){null!=e&&0<e.length?t(e):infoMessage({title:message.grupo.list.title,content:message.grupo.list.empty})})}catch(e){console.log(e)}},get:function(e,t){try{connector.post(url.grupo.get,JSON.stringify(e),function(e){void 0!==e.gpoNombre?t(e):errorMessage({title:message.grupo.get.title,content:message.grupo.get.error})})}catch(e){console.error(e)}}};